INSERT INTO `campanii` (`name`, `description`, `type`, `category`, `duration`, `begining`, `hour`, `location`, `location_address`, `phone`, `email`, `date`, `event_date`, `imageId`) VALUES
('Iubesc natura!', 'Iubesc natura. Acest mesaj este de a va impartasi voua cat de tare imi place mie natura. Merg prin natura in fiecare zi pentru a-mi reimprospata viata. Alerg prin natura, ma joc prin natura, traiesc prin natura!', '3', '3', '2h10m', '01:15', '', '24', 'Buznea', 746244007, 'trrenty@gmail.com', '2020-06-11 08:02:22', '2020-06-15', 38),
('Nu mai taiati copacii', 'România pierde cca.3 hectare de pădure pe oră, 62 de cazuri de tăieri ilegale înregistrându-se în fiecare zi, relevă cel mai nou raport Greenpeace România, care a monitorizat, pe baza datelor autorităţilor, defrişările ilegale în perioada 2016 -2017.', '3', '2', '2h10m', '01:15', '', '1', 'Buznea', 746244007, 'trrenty@gmail.com', '2020-06-11 07:48:54', '2020-06-20', 36),
('Strangere de fonduri pentru replantarea padurii Buznea', 'Crearea unei păduri reprezintă un proces de lungă durată care se întinde pe parcursul a zeci de ani. Nu este de ajuns doar o plantare pentru ca în locul respectiv să se dezvolte o pădure.', '3', '3', '2h10m', '01:15', '', '24', 'Buznea', 746244007, 'trrenty@gmail.com', '2020-06-11 07:58:55', '2020-06-15', 37),
('Strangerea Deseurilor Buznea', 'Ne adunam sa strangem gunoaiele de pe marginile strazilor de-a lungul raului Bahluiet. De asemenea, dorim sa ne adunam dupa la un gratar si sa mancam mici si bere si sa aruncam peturile pe deal!', '2', '3', '2h10m', '01:15', '', '24', 'Buznea', 746244007, 'trrenty@gmail.com', '2020-06-10 23:49:38', '2020-06-14', 34),
('Ziua Planetei', 'În fiecare an, ziua de 22 aprilie se sărbătorește Ziua Pământului, ziua când s-a născut mișcarea pentru protejarea mediului înconjurător. Această mișcare s-a născut în SUA într-o perioadă când au avut loc mai multe evenimente deosebite, printre care înăbușirea prin folosirea armelor de foc a revoltei unor studenți împotriva războiului din Cambodgia, „Masacrul din 4 mai”, apariția fibrelor optice, succesul melodiei „Bridge over Troubled Water”, ultimul album al formației Beatles, moartea lui Jimi Hendrix, un accident nuclear în Carolina de Sud la centrala nucleară din Savannah River din apropierea orașului Aiken (nerecunoscut timp de 18 ani), poluarea foarte mare cu gaze și fum, considerată ”semn al prosperității”. Despre mediul înconjurător a început să se vorbească din ce în ce mai des.', '3', '2', '2h10m', '01:15', '', '13', 'Radaseni', 746244007, 'trrenty@gmail.com', '2020-06-11 07:46:21', '2020-06-20', 35);

